create table egg
(
    EggID       int auto_increment
        primary key,
    DuckID      int              not null,
    Name        text             null,
    Age         int              null,
    IsActive    bit default b'1' null,
    CreatedBy   text             null,
    CreatedDate datetime         null,
    UpdatedBy   text             null,
    UpdatedDate datetime         null,
    IsDeleted   bit default b'0' null
);

